content:
그냥 초능력 갖고 적당히 써먹다가 좀 짧게 살고 말겠다... 
아님 차라리 초능력의 댓가를 빨리 알려주지 
29살이나 되서 알려주는데다가 홀랑 뺏어가버리냐;;

성소수자들이 서로좋아하던말던 내알빤아니지만 
이해못하는사람들 전부나쁜사람으로 몰아가는거 진심 같잖음;
이해못한다고 무조건 싫어하는것도 아니고 걍관심이없는데 무조건 이해해야해!! 찡찡찡 없던 혐오도생길듯

충격이고 죄송스럽네요. 
미래의 시간 작가님이셨다니;;; 
미.간도 재밌게 봤지만 무능력자 완전 짱♡

작가님 작화가 일단 너므 쥑이네요
너무 서정적이면서 오묘한느낌 ㅡ
스토리도 잘 보고 있어요!!! &gt; &lt;
